void xillybus_wrapper::thread_ap_clk_no_reset_() {
    if ( ap_rst.read() == ap_const_logic_1) {
        Loop_1_proc_U0_ap_start = ap_const_logic_0;
    } else {
        Loop_1_proc_U0_ap_start = ap_const_logic_1;
    }
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_sync_reg_channel_write_cells_bin_V = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, (compute_cells_U0_ap_done.read() & 
             compute_cells_U0_ap_continue.read()))) {
            ap_sync_reg_channel_write_cells_bin_V = ap_const_logic_0;
        } else {
            ap_sync_reg_channel_write_cells_bin_V = ap_sync_channel_write_cells_bin_V.read();
        }
    }
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_sync_reg_channel_write_cells_mag_sq_V = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, (compute_cells_U0_ap_done.read() & 
             compute_cells_U0_ap_continue.read()))) {
            ap_sync_reg_channel_write_cells_mag_sq_V = ap_const_logic_0;
        } else {
            ap_sync_reg_channel_write_cells_mag_sq_V = ap_sync_channel_write_cells_mag_sq_V.read();
        }
    }
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_sync_reg_channel_write_grad_vote_bin_V = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, (compute_gradients_U0_ap_done.read() & 
             compute_gradients_U0_ap_continue.read()))) {
            ap_sync_reg_channel_write_grad_vote_bin_V = ap_const_logic_0;
        } else {
            ap_sync_reg_channel_write_grad_vote_bin_V = ap_sync_channel_write_grad_vote_bin_V.read();
        }
    }
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_sync_reg_channel_write_grad_vote_magnitude_s = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, (compute_gradients_U0_ap_done.read() & 
             compute_gradients_U0_ap_continue.read()))) {
            ap_sync_reg_channel_write_grad_vote_magnitude_s = ap_const_logic_0;
        } else {
            ap_sync_reg_channel_write_grad_vote_magnitude_s = ap_sync_channel_write_grad_vote_magnitude_s.read();
        }
    }
}

